import React, {Component} from 'react';
import {Button, Header, Container, Image, Card} from 'semantic-ui-react';
import patientAvatar from '../images/avatar.png';
import matthew from '../images/matthew.png';

class Nav extends Component{
    render(){
        return(
            <div>

                <Container>
					<Card>
						<Image src={matthew}></Image>
						<Card.Header>Patient's Name</Card.Header>
						<Card.Content>
							<Card.Meta>
								<span className="date">April 18, 1995 | Male</span>
							</Card.Meta>

						<Card.Description>
							<p>3rd St., 3rd., Aurea Subd., City of San Fernando</p>
							<p>09265035246</p>
						</Card.Description>


						</Card.Content>

						<Card.Content extra>
							<Button>View All Information</Button>
						</Card.Content>
					</Card>



                    <Image src={patientAvatar}/>
                    <Header></Header>
                    <Header size="medium">Patient's Name</Header>
					<p>April 18, 1995 | Male</p>
					<p>3rd St., 3rd Blk., Auread Subd., City of San Fernando</p>

					<Button color="blue">View Information</Button>
                	<Button color="blue">Edit Information</Button>


                </Container>


            </div>
        );
    }
}

export default Nav;
